import { useState, useEffect } from "react";
import "./roster.css";
import { pokemon } from "../pokemon/pokemon.json";
import PokemonBasic from "../pokemon/PokemonBasic.jsx";

export default function Roster() {
  const imgDir = process.env.PUBLIC_URL;

  return (
    <div className="roster">
      <h1>Roster</h1>
      {console.log(imgDir)}

      {pokemon.map(p => (
        <PokemonBasic p={p} />
      ))}
    </div>
  );
}
